    <script>
        (function($) {
            var dvStat = false;
            var CheckboxDropdown = function(el) {
                var _this = this;
                this.isOpen = false;
                this.$el = $(el);
                this.$label = this.$el.find('.dropdown-label');
                this.$inputs = this.$el.find('[type="checkbox"]');

                this.onCheckBox();

                this.$label.on('click', function(e) {
                    e.preventDefault();
                    _this.toggleOpen();
                });

                this.$inputs.on('change', function(e) {
                    _this.onCheckBox();
                });
            };

            CheckboxDropdown.prototype.onCheckBox = function() {
                this.updateStatus();
            };

            CheckboxDropdown.prototype.updateStatus = function() {
                var checked = this.$el.find(':checked');
  
                if ((!dvStat) && (checked[checked.length - 1].value == 'dv')){
                    var data = VARIABLE_MAP['dv'];
                    var grid = [[]];
                    var layout = {
                        margin: {t:10, r:80, l:20, b:20},
                        grid: {
                            rows:2,
                            columns:3,
                            pattern: 'independent',
                            xgap:0.1,
                        },
                        xaxis: { tickformat: "%Y/%m/%d", tickfont: {size: 10} },
                        xaxis2: { tickformat: "%Y/%m/%d", tickfont: {size: 10} },
                        xaxis3: { tickformat: "%Y/%m/%d", tickfont: {size: 10} },
                        xaxis4: { tickformat: "%Y/%m/%d", tickfont: {size: 10} },
                        xaxis5: { tickformat: "%Y/%m/%d", tickfont: {size: 10} },
                        xaxis6: { tickformat: "%Y/%m/%d", tickfont: {size: 10} },
                        
                        yaxis: { showticklabels: false },
                        yaxis2: { showticklabels: false },
                        yaxis3: { showticklabels: false },
                        yaxis4: { showticklabels: false },
                        yaxis5: { showticklabels: false },
                        yaxis6: { showticklabels: false }
                        
                    };
                    for(var n = 0; n < checked.length; n++) {
                        $(checked[n]).prop('checked', n == checked.length - 1 ? true : false);
                    }
                    dvStat = true;
                } else {
                    var data = [ohlc];
                    var grid = [['ohlc']];
                    var currentY = 1;
                    var layout = {
                        margin: {t:10, r:80, l:20, b:20},
                        grid: {
                            rows:1,
                            columns:1,
                            xaxes:['x'],
                        },
                        hovermode: "x unified",
                        legend:{
                            bgcolor: "white",
                            bordercolor: "#444",
                            borderwidth: 0,
                            font: {
                                size: 9,
                            },
                            groupclick: "togglegroup",
                            itemclick: "toggle",
                            itemdoubleclick: "toggleothers",
                            itemsizing: "trace",
                            itemwidth: 30,
                            orientation: "h",
                            tracegroupgap: 10,
                            traceorder: "normal",
                            valign: "middle",
                            xanchor: "right",
                            x: 1.0,
                            yanchor: "bottom",
                            y: 1.0,
                        },
                        xaxis: {"autorange": true, "color": "#444", "showgrid": true, "gridcolor": "lightgrey", "griddash": "solid", "gridwidth": 0.5, "showline": true, "linecolor": "black", "linewidth": 2, "mirror": false, "rangeslider": {"visible": false}, "rangeselector": {"visible": true, "bgcolor": "#eee", "bordercolor": "#444", "borderwidth": 0, "buttons": [{"count": 1, "label": "1M", "step": "month", "stepmode": "backward"}, {"count": 3, "label": "3M", "step": "month", "stepmode": "backward"}, {"count": 6, "label": "6M", "step": "month", "stepmode": "backward"}, {"count": 1, "label": "YTD", "step": "year", "stepmode": "todate"}, {"count": 1, "label": "1Y", "step": "year", "stepmode": "backward"}, {"step": "all"}], "xanchor": "left", "x": 0.005, "yanchor": "bottom", "y": 1.0}, "showticklabels": true, "tickformat": "%Y/%m/%d", "zeroline": true, "zerolinecolor": "lightgrey", "zerolinewidth": 1},
                        yaxis: {"domain": [0, 1], "side": "right", "showticklabels": true, "tickformat": ",d", "autorange": true, "color": "#444", "showgrid": true, "gridcolor": "lightgrey", "griddash": "solid", "gridwidth": 0.5, "showline": true, "linecolor": "grey", "linewidth": 1, "mirror": false, "zeroline": true, "zerolinecolor": "lightgrey", "zerolinewidth": 1},
                    };
                    
                    /* TRACE 선택 */
                    for(var i = 0; i < checked.length; i++) {
                        if (checked[i].value == 'dv') {
                            $(checked[i]).prop('checked', false);
                            continue;
                        }
                        if (BELOW_INDICATORS.includes(checked[i].value)) {
                            /* 하단 지표 CASE */
                            if (grid.length >= 3) {
                                alert("하단(보조) 지표는 최대 3개까지 가능합니다.");
                                $(checked[i]).prop('checked', false);
                                return;
                            }
                            
                            grid.push(checked[i].value);                        
                            layout[`yaxis${grid.length}`] = {"domain": [0, 1], "side": "right", "showticklabels": true, "tickformat": ",d", "autorange": true, "color": "#444", "showgrid": true, "gridcolor": "lightgrey", "griddash": "solid", "gridwidth": 0.5, "showline": true, "linecolor": "grey", "linewidth": 1, "mirror": false, "zeroline": true, "zerolinecolor": "lightgrey", "zerolinewidth": 1};
                            VARIABLE_MAP[checked[i].value].forEach(item => {
                                item.yaxis = `y${grid.length}`;
                            });
                            if (checked[i].value == "volume") {
                                layout[`yaxis${grid.length}`].tickformat = "";
                            }
                        } else {
                            /* 상단 지표 CASE */
                            grid[0].push(checked[i].value);
                        }
                        data.push(...VARIABLE_MAP[checked[i].value]);
                    }
                    
                    if (grid.length > 1) {
                        layout.grid.rows = grid.length;
                        GRID_RATIO[layout.grid.rows].map((height, n) => {
                            const start = currentY - height;
                            if (n == 0) {
                                layout.yaxis.domain = [start, currentY];                
                            } else {
                                layout[`yaxis${n + 1}`].domain = [start, currentY];         
                            }
                            currentY = start;
                        });                
                    }
                    dvStat = false;
                }
                
                if (this.isOpen) {
                    this.toggleOpen();
                } 
   
                Plotly.newPlot('plotly', data, layout, option);

                    Plotly.relayout('plotly', {'xaxis.range': X_RANGE});
                }
            };

            CheckboxDropdown.prototype.toggleOpen = function(forceOpen) {
                var _this = this;

                if(!this.isOpen || forceOpen) {
                    this.isOpen = true;
                    this.$el.addClass('on');
                    $(document).on('click', function(e) {
                        if(!$(e.target).closest('[data-control]').length) {
                            _this.toggleOpen();
                        }
                    });
                } else {
                    this.isOpen = false;
                    this.$el.removeClass('on');
                    $(document).off('click');
                }
            };

            var checkboxesDropdowns = document.querySelectorAll('[data-control="checkbox-dropdown"]');
            for(var i = 0, length = checkboxesDropdowns.length; i < length; i++) {
                new CheckboxDropdown(checkboxesDropdowns[i]);
            }
